INSERT INTO `language_fields` VALUES (1717, '理才网为用户提供集成的云平台服务，用户通过daydao云服务平台对人力资源管理、财务管理、销售管理、协同办公等水平云产品应用及信息、交通、建设、餐饮、医疗等垂直云产品应用进行集成和部署。', 'Through the daydao cloud service platform, users can integrate and deploy horizontal cloud applications such as human resource management, financial management, sales management and collaborative office, as well as vertical cloud applications such as information, transportation, construction, catering and medical services.', 'section_3_p4', 41, '0,1968', '2020-08-06 12:00:01', '2020-08-06 10:45:52', 'userAgreement', '0');
INSERT INTO `language_fields` VALUES (1718, '其他伙伴提供的相关增值服务', 'Related value-added services provided by other partners', 'section_3_p5', 41, '0,1968', '2020-08-06 11:59:45', '2020-08-06 10:46:12', 'userAgreement', '0');
INSERT INTO `language_fields` VALUES (1719, '理才网会根据用户的各种需求，推荐伙伴提供各种包括但不限于咨询、培训、信息分析等服务，通过系统协助完成在线交易。', 'In accordance with the various needs of our users, we will recommend partners to provide various services including, but not limited to, consulting, training, information analysis, and other services to assist in completing online transactions through the system.', 'section_3_p6', 41, '0,1968', '2020-08-06 11:59:32', '2020-08-06 10:46:34', 'userAgreement', '0');
INSERT INTO `language_fields` VALUES (1720, '四、用户使用规则', ' fourth:User rules', 'section_4_title', 41, '0,1968', '2020-08-06 11:59:19', '2020-08-06 10:47:04', 'userAgreement', '0');
INSERT INTO `language_fields` VALUES (1721, '特别提示用户，使用理才网提供的网络服务必须遵守国家有关的政策和法律，包括刑法、国家安全法、保密法及其他计算机信息系统安全保护条例等，用户应自觉维护国家利益，保护国家安全，对于违法使用理才网提供的网络服务而引起的一切责任，由用户自行承担全部责任。', 'In particular, users are reminded that the use of the network services provided by Rizai.com must comply with the relevant policies and laws of the country, including the Criminal Law, the National Security Law, the Secrecy Law and other computer information system security protection regulations, etc. Users should consciously safeguard national interests and protect national security, and the user shall assume full responsibility for any liability arising from the illegal use of the network services provided by Rizai.com.', 'section_4_p1', 41, '0,1968', '2020-08-06 11:58:46', '2020-08-06 10:47:30', 'userAgreement', '0');
INSERT INTO `language_fields` VALUES (1722, '用户在申请使用理才网提供的网络服务时，必须向理才网提供真实准确的个人资料或机构资料，如个人资料或机构资料有任何变动，必须及时更新。', 'Users must provide accurate and truthful personal or organizational information to Ridgetop.com when applying to use the network services provided by Ridgetop.com, and must promptly update any changes to personal or organizational information.', 'section_4_p2', 41, '0,1968', '2020-08-06 11:58:22', '2020-08-06 10:47:56', 'userAgreement', '0');
INSERT INTO `language_fields` VALUES (1723, '用户注册成功后，理才网将给予每个用户一个/多个用户帐号及相应的密码，该用户帐号和密码由用户负责保管；用户可随时改变自己的密码。用户应当对以其用户帐号进行的所有活动和事件承担法律责任，用户若发现任何非法使用本人用户帐号或安全漏洞的情况，立即通告理才网。', 'Do you update the bank card in the payroll file according to the bank card information in [Displayed in the list] in the organization and personnel - employee file? This will add bank card information for employees who have payroll rules in their payroll file but do not have a bank card set up. This operation does not modify the payroll file for which you have set up a bank card. Once the user has registered, each user will be given one or more user accounts and a corresponding password. You are legally responsible for all activities and events that occur under your account. If you discover any illegal use of your account or any security breach, you shall immediately notify Ridgetop.com. Case.', 'section_4_p3', 41, '0,1968', '2020-08-06 11:58:05', '2020-08-06 10:48:34', 'userAgreement', '0');
INSERT INTO `language_fields` VALUES (1724, '请认真核对绩效考核结果后，点击审核！结果将计入员工最终评分及最终等级。', 'Please check your performance appraisal results carefully and click the [audit] button! The results will count into the employee\'s final rating and level.', 'auditTips', 37, '0,456', '2020-08-06 17:17:49', '2020-08-06 10:51:06', 'auditPage', '0');
